INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (104911, 16112, 0.5, "リノちゃん、こーら☆\nそんな言い方失礼だよ？\nマスターはいつも忙しくて\n大変なんだから。", 16112028, 10, 0, 1, 0, 1, 11);
