INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES ("vo_wac_220730", 16612, "", "vo_wac_220730_000", 16612025, 0, "", "", "", 0, 21);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (100911, 16612, 0.5, "ふふ、やった！　やったぞ！\nまたしても傑作の完成だ！\nみんなの努力が実る、この瞬間……\n何度やっても達成感があるな！", 16612026, 10, 0, 1, 0, 1, 11);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 16612, "", "", 16612027, "", "", "", "", "", 91);
