INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (102711, 16612, "", "wac_talk_sad_in", 16612029, 0, 0.2, 1, "", "wac_talk_sad_loop", 3);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES ("vo_wac_220730", 16612, "", "vo_wac_220730_001", 16612030, 0, "", "", "", 0, 21);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (102711, 16612, 0.5, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 16612031, 10, 0, 1, 0, 1, 11);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 16612, "", "", 16612032, "", "", "", "", "", 91);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (102711, 16612, "", "wac_idle_sad", 16612033, 1, 0.2, 1, "", "", 3);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (101311, 16612, "", "wac_talk_smile_in", 16612034, 0, 0.2, 1, "", "wac_talk_smile_loop", 3);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES ("vo_wac_220730", 16612, "", "vo_wac_220730_002", 16612035, 0, "", "", "", 0, 21);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (101311, 16612, 0.5, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 16612036, 10, 0, 1, 0, 1, 11);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 16612, "", "", 16612037, "", "", "", "", "", 91);
