INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (105111, 16612, "", "wac_talk_surprise_loop_shy", 16612039, 1, 0.2, "", "", "", 3);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES ("vo_wac_220730", 16612, "", "vo_wac_220730_003", 16612040, 0, "", "", "", 0, 21);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (105111, 16612, 0.5, "まったくもう……\nみんなして絵の具まみれじゃない。\nって、あら？　この赤いのは……", 16612041, 10, 0, 1, 0, 1, 11);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (0, 16612, "", "", 16612042, "", "", "", "", "", 91);
