INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES ("vo_wac_220730", 16612, "", "vo_wac_220730_004", 16612045, 0, "", "", "", 0, 21);
INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (105611, 16612, 0.5, "ふふ、そういうアンタも、\nほっぺに絵の具がついてるじゃないか。\nほら、きれいにしてやるから\nそこに並びな、アンタたち。", 16612046, 10, 0, 1, 0, 1, 11);
