INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (105111, 18812, 0.5, "これってテーマなんてあったの？\nあくまでギルドの仕事であって、\n指示書に忠実に描けばいいと\n思ってたんだけれど。", 18812041, 10, 0, 1, 0, 1, 11);
