INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (110911, 21312, 0.5, "あのう、チエルまだバイト代、\n通称国家予算もらってないんですけど。\nコレ大丈夫なやつですかね。\n国家バックレ案件じゃないですよね？", 21312018, 10, 0, 1, 0, 1, 11);
