INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (110811, 21312, 0.5, "あァ、国家そういうトコあんだよ。\nうちも前に世界救う的なバイトしたけど\nあいつあんときの日給まだくんないわ。", 21312023, 10, 0, 1, 0, 1, 11);
