INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (104511, 23812, 0.5, "そ、そうですね……\nそんなきれいな風景の中で、\nただ一人辱めを受けている\n自分とかを想像すると……じゅるり♪", 23812031, 10, 0, 1, 0, 1, 11);
