INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (100511, 28412, 0.5, "これでバッチリッス！\nどうッスか？\nトラタイガーみたいにかっこよく\n描けてるんじゃないッスかね？", 28412022, 10, 0, 1, 0, 1, 11);
