INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (103711, 28412, 0.5, "ふふっ、そうだね。\n君の憧れてるヒーローみたいに\nちゃんと描けてるよ。\n……一時はどうなるかと思ったけど。", 28412027, 10, 0, 1, 0, 1, 11);
