INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (123011, 36912, 0.5, "ソルの塔から見てはいたけど、\n実際絵を描くとなると大変ね～\n……でも、悪くないわ。\nこうして、一緒に何か作るのって。", 36912022, 10, 0, 1, 0, 1, 11);
