INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (100311, 36912, 0.5, "そう言ってもらえてなによりだよ。\n今日、こうして壁に描かれた絵も、\nきっと素敵な思い出になる。", 36912027, 10, 0, 1, 0, 1, 11);
