INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (103411, 39512, 0.5, "う～ん……飲み過ぎたかしら……？\n頭が痛くて、集中できないわ～……\nアキノさん、私の担当部分、\nちゃんとできてるかしら？", 39512022, 10, 0, 1, 0, 1, 11);
